import React, { Component } from "react";

import "./Tutorial.css";

export default class Tutorial extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="tutorial">
        <h3 className="title">Welcome to the Pathfinding Simulator</h3>
        <div>
          <img src="./../../gifs//destination.gif" alt="destination"></img>
        </div>
        <h6>This short tutorial will take you through the application.</h6>
        <p className="paragraph">
          If you want to skip the tutorial, feel free to press "Skip Tutorial".
        </p>
        <div className="page">1/9</div>
        <button className="next">Next</button>
        <button className="previous">Previous</button>
        <button className="skip">Skip Tutorial</button>
      </div>
    );
  }
}
